(async function () {

    /* ===============================
       CONFIGURACI√ìN
    =============================== */

    const protectedPaths = [
        "/hack-the-box/machines/medium/linux/interpreter/write%20up/"
    ];

    // üî¥ PEGA AQU√ç TU BASE64 GIGANTE
    const encryptedContent = "";

    /* ===============================
       FUNCIONES CRIPTO
    =============================== */

    async function sha256(message) {
        const msgBuffer = new TextEncoder().encode(message);
        const hashBuffer = await crypto.subtle.digest("SHA-256", msgBuffer);
        return hashBuffer;
    }

    async function decryptContent(base64Data, password) {
        try {
            const data = Uint8Array.from(atob(base64Data), c => c.charCodeAt(0));

            const iv = data.slice(0, 16);
            const hmac = data.slice(16, 48);
            const ciphertext = data.slice(48);

            const keyBuffer = await sha256(password);

            const cryptoKey = await crypto.subtle.importKey(
                "raw",
                keyBuffer,
                { name: "AES-CBC" },
                false,
                ["decrypt"]
            );

            const decrypted = await crypto.subtle.decrypt(
                { name: "AES-CBC", iv: iv },
                cryptoKey,
                ciphertext
            );

            return new TextDecoder().decode(decrypted);

        } catch (e) {
            return null;
        }
    }

    /* ===============================
       L√ìGICA PRINCIPAL
    =============================== */

    function needsProtection() {
        const currentPath = window.location.pathname.toLowerCase();
        return protectedPaths.some(path => currentPath.includes(path));
    }

    async function protectPage() {

        if (!needsProtection()) return;

        const container = document.getElementById("protected-content");
        if (!container) return;

        container.innerHTML = `
            <div style="
                display:flex;
                justify-content:center;
                align-items:center;
                height:60vh;
                flex-direction:column;
            ">
                <h2>Restricted Access</h2>
                <input type="password" id="auth-input" placeholder="Enter password"
                    style="padding:10px;margin:10px;width:250px;">
                <button id="auth-btn"
                    style="padding:10px 20px;cursor:pointer;">Unlock</button>
                <p id="auth-error" style="color:red;"></p>
            </div>
        `;

        document.getElementById("auth-btn").onclick = async () => {
            const inputPassword = document.getElementById("auth-input").value;

            const decryptedHTML = await decryptContent(encryptedContent, inputPassword);

            if (decryptedHTML) {
                container.innerHTML = decryptedHTML;
            } else {
                document.getElementById("auth-error").innerText = "Wrong password";
            }
        };
    }

    /* ===============================
       MATERIAL SPA SUPPORT
    =============================== */

    if (typeof document$ !== "undefined") {
        document$.subscribe(function () {
            protectPage();
        });
    }

    window.addEventListener("load", protectPage);

})();